import PropTypes from "prop-types";

import Layout from "../components/Layout";
import AppointmentForm from "../components/assistance/appointmentForm";

import {
  Grid,
  Typography,
  Divider,
  makeStyles,
  Paper,
  Tabs,
  Tab,
  Box,
} from "@material-ui/core";

const a11yProps = (index) => {
  return {
    id: `vertical-tab-${index}`,
    "aria-controls": `vertical-tabpanel-${index}`,
  };
};

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper,
    display: "flex",
    //height: 224,
  },
  tabs: {
    borderRight: `1px solid ${theme.palette.divider}`,
  },

  container: {
    marginTop: 60,
    padding: 30,
    backgroundColor: "white",
  },
  divider: {
    height: 1,
    marginTop: 10,
    marginBottom: 10,
    backgroundColor: "black",
  },
}));

const Assistance = () => {
  const classes = useStyles();

  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Layout>
      <div>
        <Grid container>
          <Grid item lg={2}></Grid>

          <Grid item lg={8}>
            <div className={classes.container}>
              <Typography variant="h2">Assistance Tomato</Typography>

              <Divider classes={{ root: classes.divider }} />

              <Typography variant="body1">
                This impressive paella is a perfect party dish and a fun meal to
                cook together with your guests. Add 1 cup of frozen peas along
                with the mussels, if you like. This impressive paella is a
                perfect party dish and a fun meal to cook together with your
                guests. Add 1 cup of frozen peas along with the mussels, if you
                like.
              </Typography>

              <Paper>
                <AppointmentForm />

                <div className={classes.root}>
                  <Tabs
                    orientation="vertical"
                    variant="scrollable"
                    value={value}
                    onChange={handleChange}
                    className={classes.tabs}
                  >
                    <Tab label="Item One" />
                    <Tab label="Item Two" />
                    <Tab label="Item Three" />
                    <Tab label="Item Four" />
                  </Tabs>
                </div>
              </Paper>
            </div>
          </Grid>

          <Grid item lg={2}></Grid>
        </Grid>
      </div>
    </Layout>
  );
};

export default Assistance;
